    "7400116": {
        "Desc": "Talk to Al",
        "Talk": [
            [
                {
                    "N": "Petit Chou",
                    "T": "Al! You're safe! I was so worried..."
                },
                {
                    "N": "Al",
                    "T": "Ah, my dear Petit Chou — and you too, Ann! We meet again at last. In those darkest of days, I thought of you, and drew strength to fight on from those thoughts."
                },
                {
                    "N": "Al",
                    "T": "Thank you, noble warriors, you who have come forth to uphold the cause of justice. Why, had I arms as slender as yours, I would tip my hat to honor you."
                },
                {
                    "N": "_1005",
                    "T": "There's no need to be so prim and proper..."
                },
                {
                    "N": "???",
                    "T": "Ann introduces you and Paimon to Al and explains what happened previously."
                },
                {
                    "N": "_1005",
                    "T": "Uh, but why's a finch's older brother a duck?"
                },
                {
                    "N": "Al",
                    "T": "Why a \"duck,\" you ask? Are such definitions important? I have a supple body, an iron will, and webbed feet with which to tread water. Of these I am proud, and that is enough."
                },
                {
                    "N": "Al",
                    "T": "And Petit Chou is Petit Chou. The sphere is the shape closest to perfection, and the most complicated of all shapes. I am most proud of my sister."
                },
                {
                    "N": "Petit Chou",
                    "T": "S—Seriously, brother, what are you talking about..."
                },
                {
                    "N": "_1005",
                    "T": "#(Actually, {NICKNAME}, what *is* Al talking about?)"
                },
                {
                    "N": "_0",
                    "T": "(He means that we shouldn't dwell too much on these details.)"
                },
                {
                    "N": "_0",
                    "T": "(I don't know... but it's probably not important.)"
                },
                {
                    "N": "Ann",
                    "T": "We members of the Narzissenkreuz Adventure Team are disparate indeed, but we have one goal. We shall save Princess Lyris, and we shall defeat the fell dragon Narcissus!"
                },
                {
                    "N": "Al",
                    "T": "Well said. The person I am now knows only that the one who stands before me is a noble and valiant knight who possesses the iron will needed to defeat Narcissus. That is enough for me."
                },
                {
                    "N": "Al",
                    "T": "Usually, the mightier the will, the larger the form needed to be its vessel, as it is in the case of Narcissus. This knight's stature is much like mine, and yet..."
                },
                {
                    "N": "_1005",
                    "T": "Ugh... Seriously, the first and last thing Paimon understood here was \"Narcissus.\" You're always going on about Narcissus this and Narcissus that... But what is it, really?"
                },
                {
                    "N": "Ann",
                    "T": "Look up, above Princess Lyris's tower — that is Narcissus."
                },
                {
                    "N": "_1005",
                    "T": "Huh? That wasn't there before the water rose..."
                },
                {
                    "N": "_0",
                    "T": "...Isn't that just an Oceanid?"
                },
                {
                    "N": "_0",
                    "T": "Good golly gosh, the fell dragon Narcissus!"
                },
                {
                    "N": "_1005",
                    "T": "Waaaait a minute, that's an Oceanid no matter how you look at it, not a dragon!"
                },
                {
                    "N": "Ann",
                    "T": "But that is the fell dragon Narcissus."
                },
                {
                    "N": "Al",
                    "T": "The dragon who invaded the Narzissenkreuz Kingdom."
                },
                {
                    "N": "Petit Chou",
                    "T": "And its wings are very huge and frightening."
                },
                {
                    "N": "_1005",
                    "T": "...But it's an Oceanid, isn't it?"
                },
                {
                    "N": "Ann",
                    "T": "#Well, {NICKNAME} and Paimon, you have seen much. What, then, should a dragon look like?"
                },
                {
                    "N": "_1005",
                    "T": "Well, if you're talking about the dragons we've fought before, they'd be..."
                }
            ]
        ]
    },
