    "7400118": {
        "Desc": "Head to the designated location",
        "Talk": [
            [
                {
                    "N": "Petit Chou",
                    "T": "Jak..."
                },
                {
                    "N": "Ann",
                    "T": "Thank goodness you're safe!"
                },
                {
                    "N": "Jak",
                    "T": "Hmm. As I thought, you were the ones who emptied the water out. Excellent, excellent! If I had hands like yours, yellow and white ones, I would be applauding already."
                },
                {
                    "N": "Al",
                    "T": "Dear friend, please show some respect. Petit Chou is doing her best..."
                },
                {
                    "N": "Jak",
                    "T": "Hmph. You are right, I suppose. She has done nothing wrong. Ultimately..."
                },
                {
                    "N": "Ann",
                    "T": "..."
                },
                {
                    "N": "Jak",
                    "T": "Forget it. The yellow and white ones here... Who are they?"
                },
                {
                    "N": "_1005",
                    "T": "Yellow and white... You mean us?"
                },
                {
                    "N": "Jak",
                    "T": "And who else would I mean? Does Petit Chou look yellower to you? Or does Ann?"
                },
                {
                    "N": "_1005",
                    "T": "Hey! You... you blue frog!"
                },
                {
                    "N": "Ann",
                    "T": "#Alright, alright, Paimon, please don't be angry. Jak, this is knight {NICKNAME} and Paimon."
                },
                {
                    "N": "Jak",
                    "T": "Hmph. A knight, you say... Then I suppose this Paimon is the squire?"
                },
                {
                    "N": "_1005",
                    "T": "No, no! Come on, why does everyone call Paimon that!?"
                },
                {
                    "N": "_0",
                    "T": "Paimon is no squire."
                },
                {
                    "N": "_0",
                    "T": "Paimon is a bard whose task is to record my adventures."
                },
                {
                    "N": "Petit Chou",
                    "T": "Is that how it is? No wonder Paimon's such a good talker!"
                },
                {
                    "N": "_1005",
                    "T": "#Hey! You stop that, {NICKNAME}, or Paimon's gonna come up with a... lively limerick to give you a licking the likes of which you've never seen!"
                },
                {
                    "N": "_1005",
                    "T": "Anyway, we're companions, alright? Companions!"
                },
                {
                    "N": "_0",
                    "T": "Paimon's my companion."
                },
                {
                    "N": "Jak",
                    "T": "I see. Then you are not some minor feudal warrior. Not in the usual sense, anyway. Are you, then, some \"honorary knight,\" one with a title that comes with little benefit?"
                },
                {
                    "N": "_1005",
                    "T": "#Well, {NICKNAME} is an Honorary Knight, but {M#he}{F#she} got it in Mondstadt for heroically doing battle with Stormterror!"
                },
                {
                    "N": "Jak",
                    "T": "Ah, then you are a dutiful, capable warrior. Very good! In that case, welcome to Orchestre Jak."
                }
            ]
        ]
    },
