    "7400122": {
        "Desc": "Clear the Bubble Formation",
        "Talk": [
            [
                {
                    "N": "Ann",
                    "T": "..."
                },
                {
                    "N": "_0",
                    "T": "You're pretty difficult yourself."
                },
                {
                    "N": "Ann",
                    "T": "He wasn't always like this. He once had a really good heart, and loved to cry. He would take care of the younger children..."
                },
                {
                    "N": "Ann",
                    "T": "But one day, he said that he would never cry again, and later still, he changed. This might be due to Rene, I fear... and Rene changed too..."
                },
                {
                    "N": "_0",
                    "T": "And who's Rene?"
                },
                {
                    "N": "Ann",
                    "T": "Um, sorry, where was I? Right, our course of action. You should ask Jak and the others. He and Al might argue a lot, but they're actually good friends."
                },
                {
                    "N": "_0",
                    "T": "..."
                },
                {
                    "N": "Ann",
                    "T": "Alain split with them. But as for me..."
                },
                {
                    "N": "_0",
                    "T": "See you."
                },
                {
                    "N": "Ann",
                    "T": "You should ask Jak and the others about our course of action. He and Al might argue a lot, but they're actually good friends."
                }
            ]
        ]
    },
