    "7400203": {
        "Desc": "Talk to Ann",
        "Talk": [
            [
                {
                    "N": "Paimon",
                    "T": "Weren't we just flying up into the sky in a bubble?"
                },
                {
                    "N": "???",
                    "T": "Yes, we were."
                },
                {
                    "N": "Paimon",
                    "T": "And we kept going up, and up, and up, until we crashed headfirst into the water, right?"
                },
                {
                    "N": "???",
                    "T": "Yes. Is there something wrong?"
                },
                {
                    "N": "Paimon",
                    "T": "Uh, there's so much wrong with this that Paimon doesn't even know where to start..."
                },
                {
                    "N": "_0",
                    "T": "Perhaps this is just one of the kingdom's magical aspects."
                },
                {
                    "N": "_0",
                    "T": "No one wishes to have their soul weighed down by gravity."
                },
                {
                    "N": "Paimon",
                    "T": "Ugh. You know what? Paimon's just not gonna ask! The Princess's treasure should be around here somewhere, right?"
                },
                {
                    "N": "???",
                    "T": "Yes. It is there, protected by a three-layered seal."
                },
                {
                    "N": "Paimon",
                    "T": "Where? Oh, you mean that? Hmm, while that outer bubble is pretty big, the treasure seems to be inside a really small chest."
                },
                {
                    "N": "Paimon",
                    "T": "And it looks like there are some threads of flowing water connected to the big bubble..."
                },
                {
                    "N": "???",
                    "T": "It seems as if the Bubble Formation here will not attack us. Hmm, in that case, let's use it to break the seals!"
                },
                {
                    "N": "???",
                    "T": "We just need to <color=#00E1FFFF>guide its projectiles to the bubble rings connected to the flowing water</color>. That should transfer the force of the projectile through the water and weaken the seals."
                },
                {
                    "N": "Paimon",
                    "T": "Yeah, those bubbles are pretty scary..."
                },
                {
                    "N": "Paimon",
                    "T": "One, two, three... Looks like there are <color=#00E1FFFF>three strands of water</color>. Once we deal with them, the treasure should be ours!"
                },
                {
                    "N": "???",
                    "T": "#That's right. It's in your hands, Knight {NICKNAME} and Paimon!"
                }
            ]
        ]
    },
