    "7400213": {
        "Desc": "Talk to the Narzissenkreuz Adventure Team",
        "Talk": [
            [
                {
                    "N": "_1005",
                    "T": "Why do Narcissus's little minions all need so many titles?"
                },
                {
                    "N": "Jak",
                    "T": "The more useless the person, the more hats they need."
                },
                {
                    "N": "Al",
                    "T": "Actually, they are mighty warriors who have caused us much harm during previous engagements. If the battle seemed easy, it was due to your great might."
                },
                {
                    "N": "Ann",
                    "T": "#Sorry, Knight {NICKNAME}, but our attacks can do nothing against these henchmen, so it is all up to you."
                },
                {
                    "N": "_0",
                    "T": "Easy-peasy."
                },
                {
                    "N": "_0",
                    "T": "Bit of a close shave, I'd say."
                },
                {
                    "N": "_1005",
                    "T": "...Y'know, where is Princess Lyris? Doesn't look like there's any path ahead."
                },
                {
                    "N": "Ann",
                    "T": "To be honest, I didn't think this far either..."
                },
                {
                    "N": "Ann",
                    "T": "Let's... keep going up, shall we?"
                },
                {
                    "N": "_1005",
                    "T": "How do we do that?"
                },
                {
                    "N": "_0",
                    "T": "You can fly up there, Paimon."
                },
                {
                    "N": "_1005",
                    "T": "Well, even if Paimon could do that... What would she do if she encountered Narcissus's minions?"
                },
                {
                    "N": "_1005",
                    "T": "And even if all the kingdom's treasures were up there... It would only feel like we found them if you were there, too!"
                },
                {
                    "N": "Al",
                    "T": "Go up, you say... Ah, I understand. We do, one and all, have a certain amount of power. It is all magic given to us by the Princess, yes, but we can do some things with it."
                },
                {
                    "N": "Ann",
                    "T": "But if we do..."
                },
                {
                    "N": "Jak",
                    "T": "We were all born from the same source. I don't see why you would be unable to understand and accept this. Has this not happened before?"
                },
                {
                    "N": "Ann",
                    "T": "I know, I know all this... in theory. But I just hate these things. I don't know why, but I just do."
                },
                {
                    "N": "Petit Chou",
                    "T": "Don't make such a face, Ann. We were born from the same waters, and we are only this way because..."
                },
                {
                    "N": "Petit Chou",
                    "T": "We bound ourselves into different shapes using thin films to keep the Princess company. Coming together once again for her sake is not strange at all!"
                },
                {
                    "N": "_1005",
                    "T": "Wait. What are you all talking about?"
                },
                {
                    "N": "Al",
                    "T": "As long as we forsake our forms and join together, we can produce greater magic. This way, we can send you to the tower's apex."
                },
                {
                    "N": "_1005",
                    "T": "Wait, but if you do that—"
                },
                {
                    "N": "Al",
                    "T": "You need not worry, friend. We came from the same body of water, so giving up our forms is not the same as what you would call \"death.\" Pure waters can turn into creatures of all sorts, and such changes do not only go one way."
                },
                {
                    "N": "Petit Chou",
                    "T": "Yup! Even if we cannot adventure or fight alongside you, we can still progress together!"
                },
                {
                    "N": "Ann",
                    "T": "..."
                },
                {
                    "N": "Ann",
                    "T": "#Knight {NICKNAME}, Paimon, what do you say?"
                },
                {
                    "N": "_0",
                    "T": "This is not our decision to make."
                },
                {
                    "N": "_0",
                    "T": "Only you can decide what your adventure team will do."
                },
                {
                    "N": "_0",
                    "T": "Only you can decide whether we proceed or not."
                },
                {
                    "N": "_0",
                    "T": "This is your story."
                },
                {
                    "N": "_1005",
                    "T": "#You're right, {NICKNAME}, but..."
                },
                {
                    "N": "Colonel Kate",
                    "T": "Give us our orders, ma'am! The tower seals have been broken, which means they can no longer hold Narcissus back. Every moment counts!"
                },
                {
                    "N": "Ann",
                    "T": "Alright. I'm counting on you all."
                },
                {
                    "N": "Colonel Kate",
                    "T": "Orders received!"
                },
                {
                    "N": "Petit Chou",
                    "T": "#Leave it to us! Go with {NICKNAME} and Paimon, Ann. Make sure you save the Princess!"
                },
                {
                    "N": "Jak",
                    "T": "Hmph. I leave Ms. Lyris in your hands."
                },
                {
                    "N": "Al",
                    "T": "In that case, dear Petit Chou..."
                },
                {
                    "N": "Al",
                    "T": "Mori, Colonel Kate, and Jak..."
                },
                {
                    "N": "Mori",
                    "T": "Okay. Bye-bye."
                },
                {
                    "N": "_1005",
                    "T": "Ah, it's just like what happened at Mori's fountain..."
                },
                {
                    "N": "Ann",
                    "T": "Our power is derived from the Princess. If so resolved, we can manifest it once more..."
                },
                {
                    "N": "Ann",
                    "T": "#Ugh. Pull yourself together, Ann! Let's go, Knight {NICKNAME}, Paimon!"
                }
            ]
        ]
    },
